import Expcard from "./Expcard";


// import Swiper core and required modules
import { Navigation, Pagination, Scrollbar, A11y } from 'swiper';

import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

let card1 = {

  date: "July, 2013 - June 2019",
  title: "Assistant Professor",
  para: "Department of Mathematical Sciences, Karakoram International University Gilgit, Pakistan"
}
let card2 = {

  date: "Semester fall, 2012",
  title: " Volunteer Lecturer",
  para: "University of Science and Technology Beijing, China"


}
let card3 = {


  date: "March 2006 - July 2013",
  title: " Lecturer",
  para: "Department of Mathematical Sciences,Karakoram International University Gilgit, Pakistan"



}
let card4 = {


  date: "",
  title: " Departmental Graduate Advisor",
  para: "Department of Mathematical Sciences, Karakoram International University Gilgit, Pakistan"


}
let card5 = {

  date: "",
  title: " Coordinator & Founding Editor-in-Chief",
  para: "KIU research journal Journal of Mountain Area Research"



}
let card6 = {

  date: "March 2017 - April 2017",
  title: " Consultant",
  para: "United Nations (United Nations Observer/Monitor for 6th census of Pakistan)"



}
let card7 = {

  date: "2016 - 2017",
  title: "Head of department",
  para: "Department of Mathematical Sciences, Karakoram International University Gilgit"



}
let card8 = {
  date: "2018 - present",
  title: "Chairman",
  para: "Department of Mathematical Sciences, Karakoram International University Gilgit"

}
let card9 = {
  date: "June, 2019 - present",
  title: "Associate Professor",
  para: "Department of Mathematical Sciences, Karakoram International University Gilgit"


}

function Experience() {

  return (
    <>
    <div className="container Experience">

    <h1 className="text-center heading mt-5">Experience</h1>
    <Swiper
      // install Swiper modules
      modules={[Navigation, Pagination, Scrollbar, A11y]}
      spaceBetween={10}
      slidesPerView={3}
     breakpoints={{
              780 :{
                slidesPerView:1
              }


     }}
      navigation

      onSwiper={(swiper) => console.log(swiper)}
      onSlideChange={() => console.log('slide change')}


    >

      <SwiperSlide> <Expcard date={card1.date} title={card1.title} para={card1.para}></Expcard></SwiperSlide>
      <SwiperSlide> <Expcard date={card2.date} title={card2.title} para={card2.para}></Expcard></SwiperSlide>
      <SwiperSlide><Expcard date={card3.date} title={card3.title} para={card3.para}></Expcard></SwiperSlide>
      <SwiperSlide> <Expcard date={card4.date} title={card4.title} para={card4.para}></Expcard></SwiperSlide>


      <SwiperSlide><Expcard date={card5.date} title={card5.title} para={card5.para}></Expcard></SwiperSlide>
      <SwiperSlide> <Expcard date={card6.date} title={card6.title} para={card6.para}></Expcard></SwiperSlide>

      <SwiperSlide><Expcard date={card7.date} title={card7.title} para={card7.para}></Expcard></SwiperSlide>
      <SwiperSlide> <Expcard date={card8.date} title={card6.title} para={card8.para}></Expcard></SwiperSlide>

      <SwiperSlide> <Expcard date={card9.date} title={card9.title} para={card9.para}></Expcard></SwiperSlide>
    </Swiper>
    </div>

  </>);
}

export default Experience;
